-- ------------------------------------------------
-- Version: v1.33
--
-- Description: Migration that introduces the identifier entity case relation
-- -------------------------------------------------

CREATE TABLE k_Identifier_Entity_Case (
    ID_IDN_CAS_ENT integer,
    lodIDN character varying(255) NOT NULL,
    lodENT character varying(255) NOT NULL,
    lodCAS character varying(255) NOT NULL,
    IDN character varying(255),
    CAS character varying(255),
    ENT character varying(255),
    Status character varying(255) NOT NULL,
    lod_IDN_CAS_ENT_V character varying(255),
    populatedBy character varying(255),
    lastTouch character varying(255),
    PRIMARY KEY (lodIDN, lodENT, lodCAS, Status),
    FOREIGN KEY (lodCAS) REFERENCES k_CaseStudy(lodCAS) ON DELETE CASCADE,
    FOREIGN KEY (lodENT) REFERENCES k_Entity(lodENT) ON DELETE CASCADE,
    FOREIGN KEY (lodIDN) REFERENCES k_Identifier(lodIDN) ON DELETE CASCADE
);

